public boolean equals(Object o) {
  if (this == o)
    return true;
  if (!(o instanceof TimelineMetric))
    return false;

  TimelineMetric m = (TimelineMetric) o;

  if (!id.equals(m.id)) {
    return false;
  }
  if (type != m.type) {
    return false;
  }
  return true;
}
